import React from "react"
import { BrowserRouter as Router, Route, Link } from "react-router-dom"
import XR from '../img/xr.jpg'
import GT from '../img/gt.jpg'
import KDYK from '../img/kdyk.jpg'
import KRK from '../img/krk.jpg'
import KMK from '../img/kmk.jpg'
// export default class App extends React.Component{
//     render(){
//         return (
    
//     }
// }
function Index() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return (
        <div>
          <h2>我们的产品</h2>
          <img src={GT}></img><br></br>
          <img src={KDYK}></img><br></br>
          <img src={KRK}></img><br></br>
          <img src={KMK}></img><br></br>
          <img src={XR}></img>
        </div>
       
    );
}

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about/">About</Link>
            </li>
            <li>
              <Link to="/users/">Users</Link>
            </li>
          </ul>
        </nav>

        <Route path="/" exact component={Index} />
        <Route path="/about/" component={About} />
        <Route path="/users/" component={Users} />
      </div>
    </Router>
  );
}

export default App;
